import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.scss']
})
export class NavbarComponent {

}
<nav>
  <ul>
    <li><a routerLink="">Home</a></li>
    <li><a routerLink="shopping">Shopping</a></li>
  </ul>
</nav>
